import React from "react";
import { Link } from "react-router-dom";

function Build_outfit() {
  return (
    <>
      <Link to={"/buildoutfit"}>
        <h1>Build Outfit Page</h1>
      </Link>
    </>
  );
}

export default Build_outfit;
